import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Card } from "react-bootstrap";



class Product extends Component{
    render() {
        return (
        <Card className='my-3 p-3 rounded'>

            <Card.Body>
            </Card.Body>

            <Card.Text as='div'>
                <div className='my-3'>
                </div>
            </Card.Text>

            <Card.Text as='h3'>
            </Card.Text>
        </Card>
        )
    }
}

export default Product;
